import React from "react";

function Aboutus() {
    return (
    // <div class = "">
    <div className ="container-fluid aboutus">
        <div class = "row">
            <div class = "col">
                <div class = "left-side">
                    <div class = "row">
                        <div class = "col">
                            ABOUT USs
                        </div>
                    </div>

                </div>
            </div>
            <div class = "col-lg-">
                <div class = "right-side">
                    <img id = "womancook" class = "img-fluid" src="./images/auntytest.svg" alt="Woman Cooking"/>
                </div>
            </div>
        </div>
    </div>
    // </div>
    );
}

export default Aboutus;
